n","\n","\n","\n","\n","\n","         "]},{"cell_type":"markdown","id":"fb327c87","metadata":{"papermill":{"duration":0.006843,"end_time":"2023-03-03T18:15:45.780094","exception":false,"start_time":"2023-03-03T18:15:45.773251","status":"completed"},"tags":[]},"source":["# SOURCE OF THE DATASET \n","\n","(a) Original owners: National Institute of Diabetes and Digestive and\n","Kidney Diseases.\n","\n","(b) Donor of database: Vincent Sigillito (vgs@aplcen.apl.jhu.edu)\n","Research Center, RMI Group Leader applied Physics Laboratory, The Johns Hopkins University Johns Hopkins Road Laurel, MD 20707 (301) 953-6231\n","\n","(c) Date received: 9 May 1990\n","\n"]},{"cell_type":"markdown","id":"2720dea6","metadata":{"papermill":{"duration":0.006839,"end_time":"2023-03-03T18:15:45.793848","exception":false,"start_time":"2023-03-03T18:15:45.787009","status":"completed"},"tags":[]},"source":["#  DATA ANALYTICS PROCESS  \n","\n","* Ask: The first phase involves defining the research question and goals of the analysis. For the diabetes dataset, we can ask questions such as: What are the factors that contribute to diabetes? What is the relationship between age, BMI, blood pressure, and other variables in the dataset with diabetes? What are the trends and patterns in the dataset over time?\n","\n","* Prepare: The second phase involves collecting and preparing the data for analysis. This includes loading the dataset, cleaning and wrangling the data, and transforming the data into a tidy format. For the diabetes dataset, we can use R and the tidyverse packages to load and clean the data, as well as transform it into a tidy format.\n","\n","* Process: The third phase involves exploring the data using descriptive statistics and visualizations to identify patterns and trends. This includes calculating summary statistics, creating histograms and density plots, and creating scatter plots and heatmaps. For the diabetes dataset, we can use R and the ggplot2 and dplyr packages to create visualizations and perform exploratory data analysis.\n","\n","* Analyze: The fourth phase involves using statistical and machine learning models to analyze the data and identify insights. For the diabetes dataset, we may not need to perform any model development since we are not aiming to predict any outcomes. However, we can still use statistical tests and regression analysis to identify the relationships between the variables in the dataset and diabetes.\n","\n","* Share: The fifth phase involves sharing the findings of the analysis with stakeholders and decision-makers. This includes creating reports, presentations, and dashboards that communicate the insights gained from the analysis. For the diabetes dataset, we can use R and the rmarkdown package to create reports and dashboards that visualize the insights gained from the analysis.\n","\n","* Act: The sixth phase involves taking action based on the insights gained from the analysis. This includes making decisions, implementing changes, and monitoring the results of the actions taken. For the diabetes dataset, the insights gained from the analysis can be used to inform public health policies and interventions to reduce the prevalence of diabetes.\n","\n","\n","\n"]},{"cell_type":"code","execution_count":1,"id":"dc10f8a6","metadata":{"execution":{"iopub.execute_input":"2023-03-03T18:15:45.81342Z","iopub.status.busy":"2023-03-03T18:15:45.810752Z","iopub.status.idle":"2023-03-03T18:15:46.540994Z","shell.execute_reply":"2023-03-03T18:15:46.539175Z"},"papermill":{"duration":0.742275,"end_time":"2023-03-03T18:15:46.543399","exception":false,"start_time":"2023-03-03T18:15:45.801124","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\n","Attaching package: ‘dplyr’\n","\n","\n","The following objects are masked from ‘package:stats’:\n","\n","    filter, lag\n","\n","\n","The following objects are masked from ‘package:base’:\n","\n","    intersect, setdiff, setequal, union\n","\n"