ABAhILEDAAAAAIgQkNgBAAAAAEQISOwAAAAAACIEJHYAAAAAABECEjsAAAAAgAgBiR0A\nAAAAQISAxA4AAAAAIEJAYgcAAAAAECH+PyGJiaPvTSpQAAAAAElFTkSuQmCC"},"metadata":{"image/png":{"height":420,"width":420}},"output_type":"display_data"}],"source":["corr<- cor(diabetes_data$Age,diabetes_data$Pregnancies )\n","corr\n","\n","\n","ggplot(data = diabetes_data, aes(x = Age, y = Pregnancies)) +\n","  geom_point(alpha = 0.5) + \n","  geom_smooth(method = \"lm\", se = FALSE) +\n","  labs(title = \"Correlation between Age and Pregnancies\",\n","       x = \"Age\",\n","       y = \"Number of Pregnancies\")\n","\n"]},{"cell_type":"markdown","id":"e86123fa","metadata":{"papermill":{"duration":0.021667,"end_time":"2023-03-03T18:15:52.319581","exception":false,"start_time":"2023-03-03T18:15:52.297914","status":"completed"},"tags":[]},"source":["# Conclusion\n","\n","\n","* Diabetes is a serious health condition that affects a significant portion of the population. In this dataset, around 35% of the individuals had diabetes.\n","\n","* Age, BMI, pregnancies, and blood pressure are among the most significant risk factors for diabetes. Individuals who are older, have a higher BMI, have had more pregnancies, and have higher blood pressure are at a higher risk of developing diabetes.\n","\n","* There is a strong correlation between age and the number of pregnancies. Younger women tend to have more pregnancies, and as they age, the number of pregnancies decreases.\n","\n","* There is a negative correlation between age and insulin levels. As individuals age, their insulin levels tend to decrease.\n","\n","* There is a positive correlation between BMI and blood pressure. Individuals with higher BMI tend to have higher blood pressure."]},{"cell_type":"markdown","id":"5ce161b2","metadata":{"papermill":{"duration":0.022422,"end_time":"2023-03-03T18:15:52.363497","exception":false,"start_time":"2023-03-03T18:15:52.341075","status":"completed"},"tags":[]},"source":["# Recommedations\n","\n","Based on these conclusions, the following recommendations can be made:\n","\n","* It is important to educate the public about the risk factors for diabetes and encourage them to adopt healthy lifestyles, such as regular exercise and a balanced diet, to prevent the onset of diabetes.\n","\n","* Regular check-ups, especially for individuals who have risk factors for diabetes, can help in early detection and management of the disease.\n","\n","* Women who have had multiple pregnancies should be advised to monitor their blood glucose levels regularly and adopt healthy lifestyles to reduce their risk of developing diabetes.\n","\n","* Individuals with high BMI should be encouraged to lose weight through healthy lifestyle choices, which can reduce their risk of developing diabetes and lower their blood pressure.\n","\n","* Further research should be conducted to better understand the genetic and environmental factors that contribute to the development of diabetes, which can help in the development of more effective prevention and treatment strategies.\n","\n","\n","\n"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":10.371518,"end_time":"2023-03-03T18:15:52.507281","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2023-03-03T18:15:42.135763","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}